"""
BLOKFISH
------------------
minimax algorithm for finding best moves in blokus
lower score is better - lossely based off remaining squares + remaining moves

"""

VERBOSE = False

def log(msg):
	if VERBOSE:
		print(msg)

def getValues(game: Blokus):
	remainingTiles = [0, 0, 0, 0]
	moves = [0, 0, 0, 0]
	# remainingPieces = [0, 0, 0, 0]
	values = [0, 0, 0, 0]
	for i, player in enumerate(game.players):
		remainingTiles[i] = player.getRemainingSquares()
		# remainingPieces = len([x for x in player.pieces if not x.placed])
		moves[i] = len(player.getLegalMoves())

	for i, move in enumerate(moves):
		# values[i] = max(0, remainingTiles[i] - moves[i]/8)
		values[i] = remainingTiles[i]
	return values

def getBoardScore(game: Blokus, playerIndex: int):
	return game.players[playerIndex].getRemainingSquares()
	
def minimax(curDepth, nodeIndex, maxTurn, scores, targetDepth):

	#base case: targetDepth reached
	if curDepth == targetDepth:
		return scores[nodeIndex]
	
	if maxTurn:
		return max(minimax(curDepth + 1, nodeIndex * 2, False, scores, targetDepth),
	     		   minimax(curDepth + 1, nodeIndex * 2 + 1, False, scores, targetDepth))
	else:
		return min(minimax(curDepth + 1, nodeIndex * 2, True, scores, targetDepth),
	     		   minimax(curDepth + 1, nodeIndex * 2 + 1, True, scores, targetDepth))

def _minimax(game: Blokus, playerIndex: int):
	# generate current value
	values = getValues(game)
	
	# generate all moves
	moves = game.players[playerIndex].getLegalMoves()

	# generate values for all actions
	games = []
	bestGameIndex = 0
	bestMoveIndex = 0
	print(f"Current values {values}")
	print(f"Searching {len(moves)} moves for best move")
	for i, move in enumerate(moves):
		newGame = copy.deepcopy(game)
		for piece in newGame.players[playerIndex].pieces:
			if piece.id == move.piece.id:
				newGame.playMove(playerIndex, Move(piece, move.rotationIndex, move.coords))
				break
		newValues = getValues(newGame)
		games.append(newGame)

		# get best game
		print(newValues)
		# add some random element here so it doesn't always play first 5 tile piece
		if newValues[playerIndex] < values[playerIndex]:
			values = newValues
			bestGameIndex = i
			bestMoveIndex = i

	game = games[bestGameIndex]
	print(game.board)
	print(f"Best move for player {playerIndex+1} was #{bestGameIndex} {moves[bestMoveIndex]} with a score of {values[0]}")
	render(game)



