"""
Get board scores in a tree
"""
def getScores(game: Blokus, playerIndex: int, depth: int, maxDepth: int):
	# generate current value
	score = getBoardScore(game, playerIndex)
	if depth == maxDepth*4:
		return score
	
	scores = []
	maxPieceLength = max([x.numTiles for x in game.players[playerIndex].pieces])
	
	# only look through moves from 5 pieces
	piecesToSearch = []
	for piece in game.players[playerIndex].pieces:
		# if piece.numTiles == maxPieceLength:
		if True: #for testing and viewing more random values
			piecesToSearch.append(piece)
	random.shuffle(piecesToSearch)
	#all pieces - 64 moves
	#5 -> 13-21 moves
	#3 -> 6-11 moves
	piecesToSearch = piecesToSearch[:3]

	#generate moves only for specific pieces
	moves = game.players[playerIndex].getLegalMovesExactPieces(piecesToSearch)
	
	# generate all moves
	# moves = game.players[playerIndex].getLegalMoves()
	# print(f"{len(moves)=}")
	

	# generate score for all actions
	games = []

	# filter out smallest pieces - takes 18 seconds without
	# takes 2 seconds with
	# moves = list(filter(lambda move: len(move.piece.tileArray) == maxPieceLength, moves))

	
	# print(f"Current score {score}")
	# print(f"Searching {len(moves)} moves for best move")
	
	for i, move in enumerate(moves):
		newGame = copy.deepcopy(game)
		# maxLength = max([len(piece.tileArray) for piece in newGame.players[playerIndex].pieces])
		for piece in newGame.players[playerIndex].pieces:
			if piece.id == move.piece.id:
				newGame.playMove(playerIndex, Move(piece, move.rotationIndex, move.coords))
				break
		newScore = getBoardScore(newGame, playerIndex)
		games.append(newGame)
		scores.append(newScore)

	minScore = min(scores)
	X = []
	# TODO - filter out only min scores? - only look at 'current' best moves?
	scores = list(filter(lambda x: x == minScore, scores))
	for i, _game in enumerate(games):
		X.append({"score": newScore, "move": "Move(...)", f"playerIndex": playerIndex, "scores": getScores(_game, (playerIndex+1)%4, depth+1, maxDepth)})

	return X
	

